    let dropEntities   = it.changes.filter(function(row){return (row.opt==='delete'&&row['type']==='entity');});
    let modifyEntities = it.changes.filter(function(row){return (row.opt==='update'&&row['type']==='entity');});

    function baseChangedDDL(beforeAfter){
        if(beforeAfter == null){
            return '';
        }
        let ret = [];
        let before = beforeAfter.before || {"defKey":"","defName":"","comment":""};
        let after = beforeAfter.after || {"defKey":"","defName":"","comment":""};
        if(before.defKey !== after.defKey){
            ret.push('ALTER TABLE '+before.defKey+' RENAME TO '+after.defKey);
        }
        let commentText = '';
        let commentChanged = false;
        if(before.defName !== after.defName){
            commentText = after.defName;
            commentChanged = true;
        }
        if(before.comment !== after.comment){
            commentChanged = true;
            if(commentText){
                commentText = (commentText+ ';'+after.comment)
            }else{
                commentText = after.comment
            }
        }
        if(commentChanged){
            ret.push('ALTER TABLE '+after.defKey+' COMMENT \''+commentText+'\'');
        }
        let baseText = '-- 基本信息:\n';
        return baseText+ret.join(';\n')+';';
    };

    function buildAddedDDL(entity){
        let ret = [];
        let fieldAdded = entity.data.fieldAdded||[];
        if(fieldAdded.length == 0){
            return '';
        }

        let firstDDL = 'ALTER TABLE '+entity.data.baseInfo.defKey;
        for (let field of fieldAdded) { 
            let ddlItem = 'ADD COLUMN `'+field.defKey+'` '+field.dbType;
            /*处理数据类型长度*/
            if(field.len>0){
                ddlItem += ('('+field.len);
                if(parseInt(field.scale)>0){
                    ddlItem += (','+field.scale);
                }
                ddlItem += ')';
            }
            if(field.notNull){
                ddlItem += ' NOT NULL';
            }
            if(field.autoIncrement){
                ddlItem += ' AUTO_INCREMENT';
            }
            if(field.defaultValue){
                ddlItem += (' DEFAULT ' + field.defaultValue);
            }
            ddlItem += (' COMMENT \''+field.defName+';'+field.comment+'\'');

            if(field.index>0 && field.afterFieldKey){
                ddlItem += (' AFTER '+field.afterFieldKey);
            }
            ret.push(ddlItem);
        }
        return firstDDL+'\n'+ret.join(',\n');
    };

    function buildRemovedDDL(entity){
        let ret = [];
        let fieldRemoved = entity.data.fieldRemoved||[];
        if(fieldRemoved.length == 0){
            return '';
        }

        let firstDDL = 'ALTER TABLE '+entity.data.baseInfo.defKey;
        for (let field of fieldRemoved) { 
            ret.push('DROP '+field.defKey);
        }
        return firstDDL+'\n'+ret.join(',\n');
    };

    function buildModifiedDDL(entity){
        let ret = [];
        let fieldModified = entity.data.fieldModified||[];

        let firstDDL = 'ALTER TABLE '+entity.data.baseInfo.defKey;
        for (let field of fieldModified) { 
            let changeDDL = '';
            let before = field.before || {};
            let after = field.after || {};
            if(before.defKey === after.defKey){
                changeDDL += (' MODIFY COLUMN `'+after.defKey+'`');
            }else{
                changeDDL += (' CHANGE COLUMN `'+before.defKey+'` `'+after.defKey+'`');
            }
            changeDDL += (' '+after.dbType);
            if(after.len>0){
                changeDDL += ('('+after.len);
                if(parseInt(after.scale)>0){
                    changeDDL += (','+after.scale);
                }
                changeDDL += ')';
            }
            if(after.notNull){
                changeDDL += ' NOT NULL';
            }
            let defaultValue = '';
            if(after.defaultValue != null && after.defaultValue.length>0){
                defaultValue = (after.defaultValue);
            }else{
                defaultValue = 'NULL';
            }
            if(defaultValue != 'NULL'){
                changeDDL += (' DEFAULT ' + defaultValue);
            }

            let comment = after.defName;
            if(after.comment){
                comment = comment + ';' + (after.comment||'');
            }
            if(comment){
                changeDDL += (' COMMENT \''+comment+'\';');
            }

            ret.push(firstDDL+' '+changeDDL);
        }
        return ret;
    };
}}
